import { configureStore } from "@reduxjs/toolkit";
import commonReducer from './reducers/CommonReducer';
import agentReducer from './reducers/AgentReducer';
export default configureStore({
  reducer: {
    common: commonReducer,
    agent: agentReducer
  },
});
